func TestResult_sanitizeFields(t *testing.T) {
	var fields = []string{
		"\tfirst_name\t",
		"\bfoo\a",
		"only_in_a_map",
		"first_name",
		"first_name",
		"\a\b\t\n\n",
		"  \n\tlast_name\t\n  "}

	t.Run("sanitize fields of a struct", func(t *testing.T) {
		var expectedFields = []sanitizedField{
			{"first_name", "FirstName"},
			{"last_name", "LastName"},
		}
		var sanitized = sanitizeFields[User](fields...)
		assert.Equal(t, expectedFields, sanitized)
	})

	t.Run("sanitize fields of a map[string]any", func(t *testing.T) {
		var expectedFields = []sanitizedField{
			{"first_name"},
			{"foo"},
			{"only_in_a_map"},
			{"last_name"},
		}
		var sanitized = sanitizeFields[map[string]interface{}](fields...)
		assert.Equal(t, expectedFields, sanitized)
	})
}

