func BenchmarkResult_With(b *testing.B) {
	var r = parseUsersFromDisk("m9.json") // Heaviest file with >1G of mock data
	fmt.Println("Starting benchmark")
	var start = time.Now()

	b.Run("0 fields", func(b *testing.B) {
		for i := 0; i < b.N; i++ {
			r.With()
		}
	})

	b.Run("2 fields", func(b *testing.B) {
		for i := 0; i < b.N; i++ {
			r.With("first_name", "last_name")
		}
	})

	b.Run("6 fields", func(b *testing.B) {
		for i := 0; i < b.N; i++ {
			r.With("address", "phone", "picture_url", "bio", "password", "created_at")
		}
	})

	b.Run("6 fields & 3 unknown", func(b *testing.B) {
		for i := 0; i < b.N; i++ {
			r.With("foo", "address", "phone", "bar", "picture_url", "bio", "password", "created_at", "baz")
		}
	})

	b.Run("all fields", func(b *testing.B) {
		for i := 0; i < b.N; i++ {
			r.With(
				"id",
				"first_name",
				"middle_name",
				"last_name",
				"surname",
				"age",
				"company",
				"job_title",
				"country",
				"city",
				"address",
				"tz",
				"picture_url",
				"phone",
				"password",
				"bio",
				"email",
				"gender",
				"ip_address",
				"archived_at",
				"created_at",
				"updated_at")
		}
	})

	fmt.Printf("%s took: %.3fs\n", b.Name(), time.Now().Sub(start).Seconds())
}
